import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './SavedPage.css';

const endpoints = {
  Summaries:   'summaries',
  Paraphrases: 'paraphrases',
  Vocab:       'vocab-list',
};

export default function SavePage() {
  const username = localStorage.getItem('username');
  const tabs = ['Summaries', 'Paraphrases', 'Vocab'];
  const [activeTab, setActiveTab] = useState(tabs[0]);
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');

  useEffect(() => {
    if (!username) {
      setMessage('Not logged in.');
      return;
    }
    setLoading(true);
    setMessage('');
    setItems([]);
    fetch(`http://127.0.0.1:5001/${endpoints[activeTab]}?username=${username}`)
      .then(res => {
        if (!res.ok) throw new Error(res.statusText);
        return res.json();
      })
      .then(data => {
        setItems(data);
      })
      .catch(err => {
        console.error(err);
        setMessage(`Failed to load ${activeTab.toLowerCase()}.`);
      })
      .finally(() => setLoading(false));
  }, [activeTab, username]);

  const handleDelete = async (id) => {
    if (!window.confirm('Delete this item?')) return;

    let endpoint = '';
    if (activeTab === 'Summaries') endpoint = 'delete-summary';
    if (activeTab === 'Paraphrases') endpoint = 'delete-paraphrase';
    if (activeTab === 'Vocab') endpoint = 'delete-vocab';

    try {
      await fetch(`http://127.0.0.1:5001/${endpoint}/${id}`, { method: 'DELETE' });
      setItems(prev => prev.filter(i => i._id !== id));
    } catch (err) {
      console.error('Delete failed', err);
      alert('❌ Failed to delete.');
    }
  };

  return (
    <div className="savepage-container" style={{
      backgroundImage: `url(${process.env.PUBLIC_URL}/photos/pages4.jpg)`,
      backgroundSize: 'cover',
      backgroundPosition: 'center'
    }}>
      <Link to="/study" className="back-home">← Back to Study</Link>
      <h1>Saved Items</h1>

      <div className="tab-bar">
        {tabs.map(tab => (
          <button
            key={tab}
            className={`tab-btn ${activeTab === tab ? 'active' : ''}`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </button>
        ))}
      </div>

      <div className="content-area">
        {loading ? (
          <p className="status-text">Loading {activeTab.toLowerCase()}…</p>
        ) : message ? (
          <p className="status-text error">{message}</p>
        ) : items.length === 0 ? (
          <p className="status-text">No {activeTab.toLowerCase()} saved yet.</p>
        ) : (
          ['manual', 'ai', 'file', 'random', 'extract-manual', 'extract-ai'].map(source =>
            items.some(i => i.source === source) && (
              <div key={source}>
                <h3 className="source-label">{source.replace('-', ' ').toUpperCase()}</h3>
                <ul className="item-list">
                  {items
                    .filter(i => i.source === source)
                    .map(i => (
                      <li key={i._id} className="item">
                        {activeTab === 'Vocab' ? (
                          <>
                            <strong>{i.word}</strong>: <span>{i.definition}</span>
                          </>
                        ) : (
                          <div
                            className="item-content"
                            dangerouslySetInnerHTML={{ __html: i.content }}
                          />
                        )}
                        <span className="item-date">{new Date(i.createdAt).toLocaleString()}</span>
                        <button
                          className="unsave-btn"
                          onClick={() => handleDelete(i._id)}
                        >
                          ✖ Unsave
                        </button>
                      </li>
                    ))}
                </ul>
              </div>
            )
          )
        )}
      </div>
    </div>
  );
}
